import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './components/app/app';
import reportWebVitals from './reportWebVitals';


const booksData = [
  {
    title: 'Замуж за коня',
    tags: 'властный герой, дерзкая героиня, муж и жена',
    price: 109,
    description: 'Знаете, как быстро выйти замуж? Разозлите отца, будьте откровенны с мачехой, откажите всем приличным женихам в городе и потеряйте волю, когда вам предложат немыслим...'
  },
  {
    title: 'Хозяин проклятого поместья',
    tags: 'первая любовь, призрак, тайны прошлого',
    price: 150,
    description: 'Мужчина, скрывающий ото всех своё лицо, или жених, подговоривший на ограбление: кто из них заслуживает моего доверия и любви? *** Ради любимого Элисон готова на всё! ...'
  },
  {
    title: 'Месть Анны-Луизы',
    tags: ': гендерная интрига, магия и тайны, юмор и любовь',
    price: 150,
    description: 'БЕСПЛАТНО! Моя жизнь пошла крахом после смс: «Свадьбы не будет». Попытка поговорить с женихом открыла причину разрыва — он женится на другой. Можно оставить всё ка...'
  },
];

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App 
       booksData={booksData}/>,
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
